import React from "react";

function List(){
    return(
        <>
        <p>My Hobbies</p>
        <ol>
            <li>Watching YouTube</li>
            <li>Reading Tech Articles</li>
            <li>Cricket</li>
        </ol>
        </>
    );
}

export default List;
